import React from "react";
import { Box, Center, Text, Grid, Col } from "@mantine/core";

const generateMantineUIComponent = (config) => {
  const { type, props, children } = config;
  return React.createElement(type, props, children);
};

const Layout3Object = {
  type: Box,
  props: {
    bg: "gray.4",
    h: 200,
    style: { borderRadius: "10px" },
  },
  children: [
    {
      type: Grid.col,
      props: { ml: "xs", mr: "xs" },
      children: ["Item 1", "Item 2", "Item 3"].map((item, index) => ({
        // type: Col,
        props: { span: 4 },
        children: generateMantineUIComponent({
          type: Box,
          props: {
            bg: "blue.1",
            h: 60,
            style: { border: "1px solid #000000", cursor: "pointer" },
          },
          children: generateMantineUIComponent({
            type: Center,
            children: generateMantineUIComponent({
              type: Text,
              children: item,
            }),
          }),
        }),
      })),
    },
  ],
};

const Layout3 = () => {
  const generatedComponent = generateMantineUIComponent(Layout3Object);
  return generatedComponent;
};

export default Layout3;
